import pandas as pd

# Creating sample dataframes with columns 'A' and 'B' and corresponding values
df1 = pd.DataFrame({
    'A': ['A0', 'A1', 'A2', 'A3'],
    'B': ['B0', 'B1', 'B2', 'B3']
})

df2 = pd.DataFrame({
    'A': ['A4', 'A5', 'A6', 'A7'],
    'B': ['B4', 'B5', 'B6', 'B7']
})

df3 = pd.DataFrame({
    'A': ['A8', 'A9', 'A10', 'A11'],
    'B': ['B8', 'B9', 'B10', 'B11']
})

# Concatenating the dataframes into a single dataframe and resetting the index
result = pd.concat([df1, df2, df3], ignore_index=True)

# Printing the resulting concatenated dataframe
print(result)

